import React from 'react';
import AlohaBurger from "../Live Retaurant/AlohaBurger.jpg";

const RestuHome = () => {
    return (
        <>
            <section className="container-fluid">
                <div className="row">
                    <div className="col-md-6">
                        <p className="text-uppercase">it's great time for a food taste of burger</p>
                        <h2 className="fw-bold text-uppercase"><span className="text-danger">Burger</span> for week</h2>
                        <h6 className="text-">Lorem ipsum dolor sit amet consectetur adipisicing elit.</h6>
                        <button className="btn btn-danger">Order</button>
                    </div>
                    <div className="col-md-6">
                        <img src={AlohaBurger} alt="" className="img " />
                    </div>
                </div>
            </section>
        </>
    )
}

export default RestuHome;
